import logo from './logo.svg';
import 'bulma/css/bulma.min.css';
import './App.css';
import headPic from './Stick.jpg';

function App() {
  return (
    <div className="section">
      <div className="container">
        <h1>Hockey Comparison Tool<img className="headPic" src={headPic} alt="headPic" /></h1>
        <br />
        <br />
        <h2>Compare: <button className="typeButton"><h2>Players</h2></button> <button className="typeButton"><h2>Teams</h2></button></h2>


      <div> 
        <Forms />
      </div>
      </div>
    </div>


  );
}

function Forms() {


  return (
    <form>
      <label>Season: </label>
      <select name="selectList" id="selectList">
        <option value="option 1">Option 1</option>
        <option value="option 2">Option 2</option>
      </select>

      <label>Team: </label>
      <select name="selectList" id="selectList">
        <option value="option 1">Option 1</option>
        <option value="option 2">Option 2</option>
      </select>

      <label>Player: </label>
      <select name="selectList" id="selectList">
        <option value="option 1">Option 1</option>
        <option value="option 2">Option 2</option>
      </select>

      <button>Submit</button>
    </form>
  )



}

export default App;
